import Banner from '../components/Header/Banner'
import Services from '../components/Services/Services'
import Testimonials from '../components/Testimonial/Testimonials'

const HomeScreen = () => {
    return (
        <main className="w-full">
            <Banner />
            <Services />
            <Testimonials />
        </main>
    )
}

export default HomeScreen
